def insertionSort(array):     
    swap=0
    for i in range(1, len(array)): 

        key = array[i] 
        j = i-1
        while j >= 0 and key < array[j] : 
                array[j + 1] = array[j] 
                j -= 1
                swap += 1
                
        array[j + 1] = key 

    return swap
  
  
